  false,\n\t\"url\": null,\n\t\"notes\": \"The effects of elimination of alligatorweed
  by granular silvex on the abundance of 12 species of aquatic plants were studied
  on the Santee National Wildlife Refuge, Lake Marion, South Carolina, from 1961 to
  1964. Three hundred and sixty duck stomachs collected from hunters during the 1961
  hunting season were examined to determine the importance of these 12 species as
  waterfowl food.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
